import React from "react";
import Draggable from "react-draggable";
import { Card } from 'react-bootstrap';
export const Vector = () => {
    return (
        <Draggable>
           <Card className="mb-2">
        <Card.Body className="text-center">Vector</Card.Body>
      </Card>
        </Draggable>
    )
}
